message:
Microsoft объявила, что забанит RT и Sputnik

— в ленте новостей больше не показывают контент RT и Sputnik;
— их приложения удалили из магазина;
— поисковик Bing снизил позицию RT в выдаче;
— рекламу RT и Sputnik в рекламной сети запретили.

А ещё Microsoft поддержит и украинских, и российских сотрудников.

ЦБ РФ объявил послабления по кредитам из-за санкций:

— Рекомендовал банкам реструктурировать долг, не назначать пени и штрафы, если финансовое положение заёмщика ухудшилось из-за санкций;

— Разрешил банкам не увеличивать резервы по кредиту, если финансовое положение заёмщика ухудшилось из-за санкций.

Кадыров после заявлений Джонсона, Трасс, Борреля и фон дер Ляйен о новых санкциях потребовал от них до 31 февраля отказаться от своих заявлений, пригрозив ответными мерами:

• закрыть чеченское небо для их джетов;
• заморозить рублёвые активы Джонсона в чеченских банках;
• ввести эмбарго на все активы британских олигархов в Ачхой-Мартане, а в случае ухудшения — и в Самашках;
• признать пережитком средневековья левостороннее движение;
• признать, что не бывает английского чая.

Чё там по краху российской экономики?

— AMD и Intel приостановили поставки своей продукции на территорию России. Ранее то же самое сделала Dell;
— Евросоюз заморозит активы Центробанка России. Поддерживать рубль смогут только скрепы;
— Евросоюз заморозит активы российских бизнесменов;
— От SWIFT отключат как минимум все банки, которые уже попали под санкции;
— «Золотые паспорта» – В С Ё. Теперь нельзя получить европейское гражданство в обмен на инвестиции.

Генсек НАТО Йенс Столтенберг:

— Цели России не ограничены Украиной, Россия добивается отвода сил НАТО из Восточной Европы;
— НАТО и ЕС намерены продолжать политику санкций против РФ, даже если это будет означать потери для них самих;
— Военная операция России на Украине не укрепит стратегическую безопасность России;
— НАТО намерена предоставить Украине, Грузии, Молдавии и Боснии и Герцеговине больше помощи для демократии;
— НАТО дополнительно разместила на востоке альянса тысячи военных, более 100 самолетов в высокой готовности, свыше 120 кораблей;
— НАТО продолжит поставлять оружие Украине, включая системы ПВО.

Постпред РФ при ЕС Чижов:

— Россия после операции выведет войска с Украины;
— Зеленского в какой-то момент ждёт трибунал;
— России не нужна территория Украины;
— Территория ДНР и ЛНР будет расширена до размера целых областей.

Также Макрон о ситуации с Украиной:

— Франция ускорит размещение своих военных в Румынии;
— Вслед за санкциями ЕС Франция введет против России свои санкции;
— Франция окажет помощь беженцам с Украины.

В инсте помощника Кадырова появились фото Кадырова с Золотовым, а также фотографии с молящимся кадыровским батальоном «где-то в лесистой местности». СМИ пишут, что лес находится под Киевом.

Тем временем США ввели новые санкции против РФ, а именно:
— Против банка ВТБ и ряда других крупных российских банков (пока неизвестно каких именно);
— Против сферы высоких технологий, совместно со странами G7;
— Ограничили возможности РФ вести бизнес в долларах, фунтах и йенах;
— На 50% ограничили импорт Россией высокотехнологической продукции;
— Новые санкции США коснутся российской космической программы и бондов крупнейших российских госкомпаний;
— Отключать Россию от SWIFT пока не будут;
— Участвовать в боях вна Украине США не будут.

Что там по апдейтам?

— Под санкции Британии попали: Кирилл Шамалов, Юрий Слюсарь, Денис Бортников, Пётр Фрадков;
— Вместе с ВТБ ещё ОАК («Объединенная авиастроительная корпорация»),  ОСК («Объединенная судостроительная корпорация») и Ростех;
— Британия запретит экспорт всех товаров двойного назначения в Россию;
— Акции ВТБ падают на 42% на бирже;
— Акции Аэрофлота падают на 30%;
— Постпред РФ при ЕС не исключил, что ограничительные меры Евросоюза могут дойти до виз для россиян.


По ситуации на украинских территориях и в ДНР/ЛНР:

— В США считают, что Киев «будет взят в течение 96 часов»;
— Обеспечен выход российских войск к городу Херсон, заявили в Минобороны РФ;
— Войска Донецкой и Луганской народных республик прорвали эшелонированную оборону ВСУ, продвинулись на 6-8 км, сообщили в Минобороны РФ;
— Российские войска установили контроль над Чернобыльской АЭС;
— В результате ударов российских вооруженных сил выведены из строя 83 наземных объекта военной инфраструктуры Украины, сообщили в Минобороны РФ;
— обеспечен выход российских войск к Херсону, разблокирован Северо-Крымский канал, восстановлена подача воды в Крым.

⚡️Обращение Зеленского к народу Украины и к западным лидерам

— Украина предлагает вернуться на путь мира;
— Наибольшая проблема на Юге, бои под Херсоном;
— Россия уже начала получать санкции, самые сильные в истории;
— Любой гражданин с боевым опытом будет полезен;
— Помогайте волонтёрам и медикам (доноры);
— «Лидеры», если вы нам сегодня не поможете, война завтра постучит к вам.

Апдейт по войне с Украиной

— Швейцария ввела санкции против трёх российских банков (пока не сказали, каких) и ограничения на поездки для 361 депутата Госдумы;
— Из App Store и Google Play удалили приложение Промсвязьбанка, против которого ранее были введены санкции. То же самое может ждать и другие банки, попавшие в санкционные списки;
— Сайты Госдумы, Правительства и Кремля находятся под DDoS-атакой;
— В Евросоюзе пока нет решения по возможному отключению России от SWIFT.

Заявления Минобороны РФ:

— В ВКС в результате ошибки техники пилотирования потерпел аварию штурмовик Су-25. Пилот успел катапультироваться, заявили в Минобороны РФ;
— Российские военные сбили украинский боевой вертолет и четыре ударных беспилотника;
— Шойгу дал специальные распоряжения всем командирам подразделений относиться с уважением к украинским военнослужащим.

Апдейт по происходящему:

— УЕФА переносит финал Лиги Чемпионов из Питера из-за ситуации с Украиной;
— Шведская энергетическая компания Vattenfall отказалась от поставок российского ядерного топлива для АЭС;
— Польша не исключает закрытия границ с РФ и Беларусью;
— Украина обратилась в ЕС с запросом на экстренную помощь;
— Посольство США вна Украине рекомендовало находящимся в стране американским гражданам укрываться в домах;
— ЕС примет очень «жёсткий пакет санкций» в отношении РФ, заявил премьер Италии;
— Власти Ростовской области привлекли дополнительные силы для охраны порядка в 11 приграничных территориях региона;
— Минобороны Беларуси назвало фейковыми сообщения об участии военных страны в операции вна Украине;
— Евросоюз готов принять в ЕС беженцев из Украины, заявила глава Еврокомиссии.

Генсек НАТО Йенс Столтенберг:

— Россия использует силу, чтобы переписать историю;
— У НАТО нет намерений развернуть силы альянса вна Украине.

Песков также добавил, что:

— У России могут возникнуть проблемы с целым рядом государств из-за ситуации вна Украине, но трудности с ними возникали и без этого;
— Операция имеет свои цели, они должны быть достигнуты;
— Россия не может оказаться за железным занавесом, закрыть такую страну невозможно;
— РФ готова общаться с руководством Украины, если Киев готов говорить по поставленным российской стороной вопросам;
— О возможности смены режима вна Украине: это вопрос выбора украинского народа;
— Неизбежная эмоциональная реакция в финансовой сфере на российскую военную операцию прогнозировалась, она выровняется, для этого приняты все меры;
— Судя по опросам, россияне поддерживают спецоперацию по демилитаризации Украины не меньше, чем признание ДНР и ЛНР.
